import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Navbar.css';
import UserIcon from '../UserIcon/UserIcon';

function Navbar({ isAuthenticated, onLogout }) {
    const [title, setTitle] = useState('My Application');
    const navigate = useNavigate();

    const handleMyApplicationClick = () => {
        setTitle('My Services');
        navigate('/my-application');
    };

    return (
        <nav className="navbar">
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><button onClick={handleMyApplicationClick}>{title}</button></li>
                <li><Link to="/shifts">Shifts</Link></li>
                <li><Link to="/internet-status">Internet Status</Link></li>
                <li><Link to="/chat">Chat</Link></li>
            </ul>

            {/* User Icon on the far right */}
            <div className="user-icon-container">
                <UserIcon isAuthenticated={isAuthenticated} onLogout={onLogout} />
            </div>
        </nav>
    );
}

export default Navbar;
